import React from "react";
import "./Toolbar.css";
import { useSelector } from "react-redux";

const Toolbar = () => {
  return (
    <div className="container-toolbar">
      <div class="parent">
        <div class="div1"> 1</div>
        <div class="div2">2 </div>
        <div class="div4"> 3</div>
      </div>
    </div>
  );
};

export default Toolbar;
